import './Search.css';
import { React, useState, classes } from "react";
import TextField from "@mui/material/TextField";
//import List from "./Components/List"
import "./App.css";
import { createTheme } from '@mui/material/styles';
import { indigo } from '@mui/material/colors';

const theme = createTheme({
    palette: {
      primary: {
        main: '#42a5f5',
      },
      secondary: indigo,
    },
  })

const Search = () => (
    <div className="search-bg">
        <div className='headline'>A home dedicated to showcasing bright futures</div>
        <div className="main">
      
      <div className="search">
        <TextField
          id="outlined-basic"
          variant="outlined"
          color="primary"
          InputLabelProps={{
            style: { color: '#fff'}, 
         }}

          sx={{
            fieldset: {                 
                '&:hover' : {
                    borderColor: "#ffffff",
                },
              borderColor : "white" },

            input : {
                '&:hover':{
                    color: "#ffffff",
                  },
                color: "#ffffff",
            },

          }}
          fullWidth
          label="Search"
        />
      </div>
      
    </div>
    </div>
    
  );
